from collections import defaultdict


class Trie:
  def __init__(self):
    T = lambda: defaultdict(T)
    self.trie = T()

  def insert(self, word):
    t = self.trie
    for c in word:
      t = t[c]
    t["$"] = True

  def find(self, word):
    t = self.trie
    for c in word:
      if c not in t:
        return False
      t = t[c]
    return "$" in t and t["$"]

  def findlast(self):
    t, res = self.trie, []
    while True:
      c = max(t.keys())
      res.append(c)
      t = t[c]
      if 1 == len(t) and "$" in t and t["$"]:
        break
    return "".join(res)


