    #   runtime; 1496ms, 5.05%
    #   memory; 25.8MB, 100.00%
    def lastSubstring(self, s):
        if len(set(s)) == 1:
            return s
        maxChar = max(s)
        idxList = [i for i, c in enumerate(s) if c == maxChar]
        maxStr = s[idxList[0]:]
        for i in idxList[1:]:
            j, curStr = 0, s[i:]
            while j < len(maxStr) and j < len(curStr) and maxStr[j] == curStr[j]:
                j += 1
            if j < len(maxStr) and j < len(curStr):
                if maxStr[j] < curStr[j]:
                    maxStr = curStr
            elif j == len(maxStr) and j < len(curStr):
                maxStr = curStr
        return maxStr


